import React from 'react';
import { Text, View } from 'react-native';

const SignUp = () => {
  return (
    <View
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
        color: '#f0f'
      }}>
      <Text>Hello, world!</Text>
    </View>
  )
}
export default SignUp
